import React from "react";
import Skill from "./Skill.js";
export default class extends React.Component{
    state={
        titles:{
            webDev:{
                title:"Web Development",
                skills:["React","SCSS"],
            },
            personal:{
                title:"Personal",
                skills:"Loving Jaymee",
            }
        }
    }
    render(){

        return(
            this.state.titles.map(card =>(
                console.log(card.title)
                // <Skill
                //     title="card.title"
                // />
            ))
            // <Skill/>
        );
    }
}
